<!DOCTYPE html>
<html lang="en">
  <head>
    
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <title>Biodata Premium Template 4</title>
    <style>
      body {
        background: #f0f4ff;
        font-family: 'Times New Roman', serif;
        margin: 0;
        padding: 0;
      }
      #template-content {
        position: relative;
        padding: 60px 80px;
        min-height: 100vh;
        width: 700px;
        margin: 40px auto;
        -webkit-print-color-adjust: exact;
        print-color-adjust: exact;
      }

      /* Decorative border image placed as an <img> so xhtml2pdf can embed it reliably */
      .template-border {
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        width: 100%;
        height: 100%;
        object-fit: cover;
        z-index: 0;
        pointer-events: none;
      }

      .template-inner {
        position: relative;
        z-index: 1; /* ensure content renders above the border image */
        background: transparent;
        width: 100%;
        height: 100%;
      }
      .biodata-name {
        text-align: center;
        font-size: 2rem;
        font-weight: bold;
        color: #2563eb;
        margin-bottom: 2rem;
      }
      .section-pill {
        background: linear-gradient(135deg, #2563eb, #60a5fa);
        color: white;
        padding: 10px 24px;
        border-radius: 25px;
        font-weight: 600;
        display: block;
        width: fit-content;
        margin: 0 auto 16px;
      }
      .detail-columns {
        display: grid;
        grid-template-columns: 1fr 1fr;
        column-gap: 40px;
      }
      .detail-item {
        display: flex;
        justify-content: space-between;
        padding: 6px 0;
        border-bottom: 1px dotted #2563eb;
      }
      .biodata-profile-image {
        width: 120px;
        height: 120px;
        border-radius: 50%;
        display: block;
        margin: 0 auto 12px;
        object-fit: cover;
        border: 4px solid #2563eb;
      }
    </style>
  </head>
